/*!

=========================================================
* Argon Dashboard React - v1.2.4
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-react
* Copyright 2024 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import Index from "views/Index.jsx";
import Profile from "views/examples/Profile.jsx";
import Maps from "views/examples/Maps.jsx";
import Register from "views/examples/Register.jsx";
import Login from "views/examples/Login.jsx";
import Tables from "views/examples/Tables.jsx";
import Icons from "views/examples/Icons.jsx";
import HealthPrograms from "views/HealthPrograms.jsx";
import Habitudes from "components/Habitude/HabitudeList.jsx";
import EvenementForm from "views/examples/Evenement.jsx"; 
import ArticleForm from "views/examples/Article.jsx"; 


var routes = [
  {
    path: "/index",
    name: "Dashboard",
    icon: "ni ni-tv-2 text-primary",
    component: <Index />,
    layout: "/admin",
  },
   {
    path: "/evenement",
    name: "Events",
    icon: "ni ni-pin-3 text-orange",
    component: <EvenementForm />,
    layout: "/admin",
  },
   {
    path: "/article",
    name: "Articles",
    icon: "ni ni-pin-3 text-orange",
    component: <ArticleForm />,
    layout: "/admin",
  },

  {
    path: "/habitudes",
    name: "Habitudes",
    icon: "ni ni-time-alarm text-orange",
    component: Habitudes,
    layout: "/admin",
  },
  {
    path: "/health-programs",
    name: "Health Programs",
    icon: "ni ni-favourite-28 text-red",
    component: <HealthPrograms />,
    layout: "/admin",
  },
  {
    path: "/icons",
    name: "Icons",
    icon: "ni ni-planet text-blue",
    component: <Icons />,
    layout: "/admin",
  },
  {
    path: "/maps",
    name: "Maps",
    icon: "ni ni-pin-3 text-orange",
    component: <Maps />,
    layout: "/admin",
  },
  {
    path: "/user-profile",
    name: "User Profile",
    icon: "ni ni-single-02 text-yellow",
    component: <Profile />,
    layout: "/admin",
  },
  {
    path: "/tables",
    name: "Tables",
    icon: "ni ni-bullet-list-67 text-red",
    component: <Tables />,
    layout: "/admin",
  },
  {
    path: "/login",
    name: "Login",
    icon: "ni ni-key-25 text-info",
    component: <Login />,
    layout: "/auth",
  },
  {
    path: "/register",
    name: "Register",
    icon: "ni ni-circle-08 text-pink",
    component: <Register />,
    layout: "/auth",
  },
];
export default routes;
